css:
.ignore-in-parent-frame body {
  color: #D9E0EE;
}
.ignore-in-parent-frame div {
  background-color: #1A1826 !important;
  color: #D9E0EE !important;
  border-color: rgba(217, 224, 238, 0.15) !important;
}
.ignore-in-parent-frame table {
  background-color: #1A1826 !important;
}
.ignore-in-parent-frame td {
  background-color: #1A1826 !important;
  color: #D9E0EE !important;
}
.ignore-in-parent-frame span {
  color: #D9E0EE !important;
}
.ignore-in-parent-frame p {
  color: #D9E0EE !important;
}
.ignore-in-parent-frame h1,
.ignore-in-parent-frame h2,
.ignore-in-parent-frame h3 {
  color: #D9E0EE !important;
}
.ignore-in-parent-frame a {
  color: #89DCEB !important;
  text-decoration: underline !important;
}
.ignore-in-parent-frame a:hover {
  color: #89DCEB !important;
}
.ignore-in-parent-frame a:visited {
  color: #F5E0DC !important;
}
.ignore-in-parent-frame hr {
  border: none;
  border-top: 1px solid rgba(217, 224, 238, 0.15);
}
.ignore-in-parent-frame blockquote {
  border-left: 1px solid rgba(217, 224, 238, 0.5) !important;
}
